function SvgSuccessOutlined(props) {
  return (
    <svg
      width={52}
      height={52}
      viewBox="0 0 52 52"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      <circle cx={26} cy={26} r={24} stroke="#44D7B6" strokeWidth={3} />
      <path
        d="M36 17L23.483 33 16 27.546"
        stroke="#44D7B6"
        strokeWidth={4}
        strokeLinecap="round"
        strokeLinejoin="round"
      />
    </svg>
  )
}

export default SvgSuccessOutlined
